import React from "react";
import "./Signin.css";
function Signin({ user, setUser }) {
  return (
    <div className="main">
      <div className="container">
        <p>Welcome to Vega6-task</p>
        <div className="form">
          <label>Name</label>
          <input
            type="text"
            placeholder="Enter your name"
            onChange={(e) => setUser({ ...user, name: e.target.name })}
          />
          <label>Email</label>
          <input
            type="email"
            placeholder="Enter your email"
            onChange={(e) => setUser({ ...user, email: e.target.name })}
          />
          <button onClick={() => console.log(user)}>Submit</button>
        </div>
      </div>
    </div>
  );
}

export default Signin;
